import React from 'react'
import Todoitem from './Todoitem';
// import todoList from "../tododata";

function Todos(props) {
    return (
        <div className='container'>
            <h3 className='text-center my-4'>Todo list</h3>
            {props.todoList.length === 0 ? "No items to display" :
                props.todoList.map((item) => { <Todoitem noteItem={item} key={item.key} onDelete={props.onDelete} /> })
            }

            
        </div>
    )
}


export default Todos;
